import React from "react";
import { Drawer, List, ListItem, ListItemIcon, ListItemText } from "@mui/material";
import { Home, Calculate, BarChart, Chat, Memory } from "@mui/icons-material";
import { Link } from "react-router-dom";

const menuItems = [
  { text: "Home", icon: <Home />, path: "/" },
  { text: "Arithmetic Aptitude", icon: <Calculate />, path: "/category/arithmetic" },
  { text: "Data Interpretation", icon: <BarChart />, path: "/category/data-interpretation" },
  { text: "Verbal Ability", icon: <Chat />, path: "/category/verbal-ability" },
  { text: "Logical Reasoning", icon: <Memory />, path: "/category/logical-reasoning" },
];

const Sidebar = () => {
  return (
    <Drawer variant="permanent" sx={{ width: 250, flexShrink: 0 }}>
      <List>
        {menuItems.map((item) => (
          <ListItem button key={item.text} component={Link} to={item.path}>
            <ListItemIcon>{item.icon}</ListItemIcon>
            <ListItemText primary={item.text} />
          </ListItem>
        ))}
      </List>
    </Drawer>
  );
};

export default Sidebar;
